import './watched.css';
import React from 'react'
import {useMoviesContext}from '../context/GlobalContext';
const Watched = () => {
  const watchedmovie=useMoviesContext();
  return (
    <div className='watched'>
      <div className="container">
        <div className="main-header">
          <h1>my watched</h1>
          <span>4movies</span>
        </div>
        <div className='watched-content'>
          {
            watched.watched.map((movie)=>{
              return(
                <div className='movie' key={movie.imdbID}>
                  <img src={movie.imdbID} alt="" />
                </div>
              )
            })
          }
        </div>
      </div>
    </div>
  )
}

export default Watched;
